import React, { useState, useEffect } from "react";
import {
  Switch,
  Route,
  NavLink,
  Prompt,
  useParams,
  useRouteMatch
} from "react-router-dom";
import "./index.css";

function App({ bookFacade }) {
  return (
    <div>
      <Header />
      <hr />
      <div className="content">
        <Switch>
          <Route exact path="/"></Route>
          <Route path="/jokes"></Route>
          <Route path="/scrape"></Route>
          <Route></Route>
        </Switch>
      </div>
    </div>
  );
}

function Header() {
  return (
    <div>
      <ul className="header">
        <li>
          <NavLink exact activeClassName="active" to="/">
            Home
          </NavLink>
        </li>
        <li>
          <NavLink activeClassName="active" to="/jokes">
            <FetchJokes />
          </NavLink>
        </li>
        <li>
          <NavLink activeClassName="active" to="/scrape">
            Scrape
          </NavLink>
        </li>
      </ul>
    </div>
  );
}

function FetchJokes() {
  const [joke, setJoke] = useState();

  useEffect(() => {
    fetch("http://localhost:8080/jokeFetcher/api/jokes")
      .then(res => res.json())
      .then(data => {
        setJoke(data);
      });
  },[]);

  return (
    <React.Fragtment>
    <p>Click to fetch some jokes!</p>
     <p> {joke.joke1}</p>
     <p> {joke.joke1reference}</p>
    </React.Fragtment>
  );
}

export default App;
